void init_rng() {
	init_genrand(0);
}


void box_muller(float &z0, float &z1) {
	float u1 = (genrand_int32() + 1) * (1.0 / 4294967296.0);
	float u2 = (genrand_int32() + 1) * (2.0 * M_PI / 4294967296.0);

	float r = std::sqrt(-2 * std::log(u1));
	z0 = r * std::cos(u2);
	z1 = r * std::sin(u2);
}

